import React, { Component } from 'react';
import './App.css';

class App extends Component {

  constructor(props){
    super(props);

    this.state = {
      nutri: []
    }

  }

  componentDidMount(){
    let url = 'https://sujeitoprogramador.com/rn-api/?api=posts';
    fetch(url)
      .then((res) => res.json())
      .then((json) => {
        let state = this.state;
        state.nutri = json;

        this.setState(state);
      });
  }


  render(){

    return (
      <div className="App">

      </div>
    );
  }
}

export default App;
